import { useForm } from "react-hook-form";
import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
    return(
        <div className="home">
            <h2>Welcome to RTT Forms.</h2>
            {/* <button type="submit">Create New Webform</button>
            <button type="submit">Browse Created Webforms</button> */}
            <nav style={{
                size:18
            }}>
                <Link to="/create">Create New Webform</Link>
                <br /><Link to="/browse">Browse Created Webforms</Link>
            </nav>
        </div>
        
    );
}

export default Home
